const { default: Axios } = require("axios");
const {
  FETCH_HOUSE_REQUEST,
  FETCH_HOUSE_SUCCESS,
  FETCH_HOUSE_FAIL,
} = require("../actionTypes");

const houseForRentAction = () => async (dispatch) => {
    const url = "/api/house-rent";

    try{
        dispatch({type:FETCH_HOUSE_REQUEST});
        const {data} =await axios.get(url);
        dispatch({type: FETCH_HOUSE_SUCCESS, payload: data });


    }
    catch(error) {
dispatch({type: FETCH_HOUSE_FAIL , payload: error}) ;


    }
};

export default houseForRentAction;
